// src/pages/Home.js
import React from 'react';
import bannerImage from '../../assets/images/Banner1.png';
import Header from '../../components/Header/Header';
import Banner from '../../components/Banner/Banner';
import Card from '../../components/Card/Card';
import '../../components/Banner/Banner.css'; 
import '../../components/Card/Card.css'; 

const Home = () => {
  const cardData = [
    { description: 'Titre de la location 1' },
    { description: 'Titre de la location 2' },
    { description: 'Titre de la location 3' },
    { description: 'Titre de la location 4' },
    { description: 'Titre de la location 5' },
    { description: 'Titre de la location 6' },
  ];

  return (
    <div className="home">
      <Header />
      <Banner title="Chez vous, partout et ailleurs" image={bannerImage} />
      <div className="home-content">
        <div className="cards-container">
          {cardData.map((card, index) => (
            <Card 
              key={index} 
              description={card.description} 
            />
          ))}
        </div>
      </div>
    </div>
  );
};

export default Home;
